for i = 1:num_vectors
    % Get the data vectors (replace 'ref' and 'measure' with the actual variable names)
    ref_vector      = eval(['ref_' num2str(i)]);
    measure_vector  = eval(['measure_' num2str(i)]);
    sum_vector      = eval(['sum_' num2str(i)]); 
    
    % Calculate FFT for reference and measurement vectors
    ref_spectrum        = fft(ref_vector);
    measure_spectrum    = fft(measure_vector);
    sum_spectrum        = fft(sum_vector .* 2);
    
    % Store the results in new variables
    eval(['ref_' num2str(i) '_spectrum = ref_spectrum;']);
    eval(['measure_' num2str(i) '_spectrum = measure_spectrum;']);
    eval(['sum_' num2str(i) '_spectrum = sum_spectrum;']);

    
    % Calculate the magnitude
    ref_magnitude = abs(ref_spectrum(2:end));
    measure_magnitude = abs(measure_spectrum(2:end));
    sum_magnitude = abs(sum_spectrum(2:end));
    
    [ref_max,max_index]     = max(ref_magnitude);
    measure_max =   measure_magnitude(max_index);
    sum_max     =   sum_magnitude(max_index)    ;
    
    
    Z(i)    = ref_max / measure_max  *100e3;
    
